import Dropzone from 'react-dropzone'

import { DropContainer /* UploadMessage */ } from './styles'

function Upload() {
	return (
		<Dropzone accept='image/*' >
			{(
				getRootProps,
				getInputProps,
				isDragActive,
				isDragReject
			) => (
				<DropContainer
					{...getRootProps()}
					isDragActive
					isDragReject>
					<input {...getRootProps()} />
				</DropContainer>
			)}
		</Dropzone>
	)
}

export default Upload
